VIS.prototype.loadCentroids=function(){var h=this;d3.csv(CONFIG.sources.centroids,function(f){svg.select("#cities_glow").selectAll("circle").data(f).enter().append("circle").attr("class","glow").attr("cx",function(f){return h.projection([f.LONG,f.LAT])[0]}).attr("cy",function(f){return h.projection([f.LONG,f.LAT])[1]}).attr("r",CONFIG.styles.citiesGlowRadiusWidth);svg.select("#cities").selectAll("circle").data(f).enter().append("circle").attr("class","dot").attr("cx",function(f){var m=Math.round(10*
Math.random()),f=h.projection([f.LONG,f.LAT]);h.centroids.push(f);1==m?h.starts.push(f):0==m&&h.ends.push(f);return f[0]}).attr("cy",function(f){return h.projection([f.LONG,f.LAT])[1]}).attr("r",CONFIG.styles.citiesRadiusWidth);h.drawParabolas(3);f=h.getRandomCenter();h.userCoordinates=f;h.addUser(f);for(f=0;f<=2+Math.round(3*Math.random());f++)h.connectUser()})};
function start(){vis=new VIS;$(".zoom_in").on("click",function(){vis.zoomIn(vis)});$(".zoom_out").on("click",function(){vis.zoomOut(vis)});vis.init()};
